/*Table structure for table `eova_role` */

DROP TABLE IF EXISTS `eova_role`;

CREATE TABLE `eova_role` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL COMMENT '角色名',
  `info` varchar(255) DEFAULT NULL COMMENT '角色描述',
  `lv` int(11) DEFAULT '0' COMMENT '权限级别',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8 COMMENT='EOVA角色';

/*Data for the table `eova_role` */

insert  into `eova_role`(`id`,`name`,`info`,`lv`) values (1,'超级管理员','开发者权限(禁止作为业务权限)',0),(2,'管理员','管理所有可用功能',10),(3,'测试组长','测试小组的组长',20),(4,'测试通用','测试通用权限',30),(7,'普通用户','普通用户',20),(8,'老师1','老师拥有权限',35),(9,'老师2','老师2权限',35);

