/*Table structure for table `v_user` */

DROP TABLE IF EXISTS `v_user`;

/*!50001 DROP VIEW IF EXISTS `v_user` */;
/*!50001 DROP TABLE IF EXISTS `v_user` */;

/*!50001 CREATE TABLE  `v_user`(
 `id` int(11) NOT NULL  default '0' ,
 `status` int(2) NULL  default '0' ,
 `nickname` varchar(255) NULL  default '' ,
 `reg_time` timestamp NULL ,
 `info` varchar(255) NULL  default '' ,
 `tag` varchar(255) NULL  default '' ,
 `login_id` varchar(30) NOT NULL ,
 `login_pwd` varchar(50) NOT NULL ,
 `rid` int(11) NULL  default '0' ,
 `user_id` int(11) NOT NULL 
)*/;

/*View structure for view v_user */

/*!50001 DROP TABLE IF EXISTS `v_user` */;
/*!50001 DROP VIEW IF EXISTS `v_user` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`skip-grants user`@`skip-grants host` SQL SECURITY DEFINER VIEW `v_user` AS select `u`.`id` AS `id`,`u`.`status` AS `status`,`u`.`nickname` AS `nickname`,`u`.`reg_time` AS `reg_time`,`u`.`info` AS `info`,`u`.`tag` AS `tag`,`l`.`login_id` AS `login_id`,`l`.`login_pwd` AS `login_pwd`,`l`.`rid` AS `rid`,`l`.`user_id` AS `user_id` from (`eova_user2` `l` join `bb_demo`.`users` `u`) where (`l`.`user_id` = `u`.`id`) */;

